function BoardHeader({ goBack, addPost, title, option }) {
  return (
    <div className="board_header">
      <div className="board_m_prev_btn" onClick={goBack}>
        <img src={require("../images/b_back-30.png")} />
      </div>
      <div className="board_m_txt">{title}</div>
      <div className="btn_add_post" onClick={addPost}>
        {option == true && <img src={require("../images/b-pencil-24.png")} />}
      </div>
    </div>
  );
}
export default BoardHeader;
